    return(
        <>
        <div className="h-screen bg-gray-500">
            <NavBar/>
            <div class="relative mix-blend-overlay">
                <img src="https://randomuser.me/api/portraits/men/70.jpg" class="absolute h-[70vh] lg:h-[80vh] w-full object-cover object-right" />
                <div class="absolute -z-10 bg-gradient-to-b from-white via-black to-black w-full" />
            </div>

            <ActiveConversations/>
        </div>
        </>
    )
}

export default Menu;
